import React from "react";
import OfficersCSS from "./Officers.css";
import OfficersSection from "./OfficerSection";

const Officers = () => {

    const officers = [    
        { name: "Jane Doe", role: "President", photo: "Ellie_Hyde.jpeg" },
        { name: "John Smith", role: "Vice President", photo: "Kai_Monno.jpeg" },
    ]


  return (
        <section id="officers">
          <h1>Our Officers</h1>
          <OfficersSection officers={officers} />

          <img src="Officer_Group_Photo.png" alt="Group of Officers" className="officers-group-photo" />

        </section>
      );

  }
export default Officers ;
